title: たたかうやつ(仮)プランBテスト版の開発用資料集
description: 説明仮

markdown: CommonMarkGhPages
commonmark:
  extensions:
    - autolink
    - strikethrough
    - table

timezone: Asia/Tokyo
encoding: utf-8

theme: jekyll-theme-primer

collections:
  temp:
    output: true
  fix:
